import React from "react";
import {
  SoftwareContainer,
  MentorshipContainer,
  ProjectCard,
  SkillsContainer,
} from "./SoftwareElements";
import visionVoiceIcon from "../../assets/visionVoice.png";

const Software = () => {
  /* Skills sections */
  const FEDevSection = () => {
    return (
      <div style={{ flex: 1 }}>
        <h1>Front-End Dev</h1>
        <p> JavaScript | TypeScript | HTML | CSS | React/Redux</p>
      </div>
    );
  };

  const BEDevSection = () => {
    return (
      <div style={{ flex: 1 }}>
        <h1>Back-End Dev</h1>
        <p>Java | Python | C++ | Spring Boot | MySQL</p>
      </div>
    );
  };

  const ToolsSection = () => {
    return (
      <div style={{ flex: 1 }}>
        <h1>Tools</h1>
        <p> Intellij | WebStorm | VSCode | Eclipse | Git</p>
      </div>
    );
  };

  /* Larger (full page width) sections*/
  const MentorshipSection = () => {
    return (
      <MentorshipContainer>
        <h1>Mentorship</h1>
        <a href="https://www.visionvoiceinc.org/" target="_blank">
        <img
          src={visionVoiceIcon}
          alt="vision voice icon"
          style={{
            width: "200px",
            float: "left",
            paddingRight: "24px",
          }}
        />
        </a>
        <p>
          Mentorship is extremely important to me, it guided me as a young woman
          in STEM, and it gives me great joy and sharpens my skills to work on
          fundamentals with my scholars. Starting in September 2021, I have
          been working one-on-one with female Black/AfroX high school students
          to facilitate their learning of foundational computer science, and
          help them to acquire skills in web development. Starting
          January-February 2022 I will begin leading the mentorship program for
          a new cohort of 30 students, mentoring and training mentors.
        </p>
      </MentorshipContainer>
    );
  };

  const ProjectsSection = () => {
    return (
      <div>
        <h1>Projects</h1>
        <br />

        <div style={{ display: "flex" }}>
          <ProjectCard style={{ flex: 1 }}><b>Pyramid Solitaire</b></ProjectCard>
          <ProjectCard style={{ flex: 1 }}><b>Nihilittle Life</b><br/>
          (in progress)
          </ProjectCard>
          <ProjectCard style={{ flex: 1 }}><b>Programmable Animator</b></ProjectCard>
        </div>
        <div style={{ display: "flex" }}>
          <ProjectCard style={{ flex: 1 }}>
            <b>Presidential Speech Issue Tracking</b><br/><br/>
             Predictive analysis model based on presidential speeches, built in
            Python using K-Nearest-Neighbor algorithm. Yielding
            70%+ accuracy on the prediction of time period, political party and
            presidential-speaker based on the text from the speech alone.
          </ProjectCard>
          <ProjectCard style={{ flex: 1 }}><b>This Website!</b><br/><br/>
          React app in HTML and JavaScript using functional components, react hooks,
            and <a href="https://styled-components.com/">styled components</a>.</ProjectCard>
        </div>
      </div>
    );
  };

  return (
    <SoftwareContainer>
      <SkillsContainer>
        <FEDevSection />
        <BEDevSection />
        <ToolsSection />
      </SkillsContainer>
      <MentorshipSection />
      <ProjectsSection />
    </SoftwareContainer>
  );
};

export default Software;
